import React, { Component } from 'react';
import {
    Line,
    SteppedLine,
    PolyLine,
    Circle,
    Rectangle
} from 'draw-shape-reactjs';

class HexagonCluster extends Component {

  constructor(props) {
    super(props);
    this.state = {
      hexagons: []
    }
  }

  // createHexagone = ({startX, startY}) => {
  //     return (
  //       {}
  //       <Line >
  //     )
  // }

  render () {
    return (
      <div>
        Hi there
        <Line
          key="0"
          position='fixed'
          from={[100, 100]}
          to={[150, 100]}
          color='#1DBFE7'
        />

        <Line
          key="1"
          position='fixed'
          from={[150, 100]}
          to={[200, 150]}
          color='#1DBFE7'
        />

        <Line
          key=""
          position='fixed'
          from={[200, 150]}
          to={[150, 200]}
          color='#1DBFE7'
        />

        <Line
          position='fixed'
          from={[100, 100]}
          to={[50, 150]}
          color='#1DBFE7'
        />
        <Line
          position='fixed'
          from={[50, 150]}
          to={[100, 200]}
          color='#1DBFE7'
        />
        <Line
          position='fixed'
          from={[100, 200]}
          to={[150, 200]}
          color='#1DBFE7'
        />

      </div>
    )
  }
}

export default HexagonCluster;
